script:
console.log(this.action);

if (this.action.name == 'sponsor') {
    window.location = this.action.value;
    return;
}

const views = {
    create: 'Create_matrix',
    pca: 'PCA',
    pls: 'PLS',
    compass: 'COMPASS',
    generate: 'Generate_matrix',
    MBPCA: 'Multi_Block_PCA',
}

let url = `https://www.cheminfo.org/flavor/metabolomics/${views[this.action.name]}/index.html`;

let dataset = API.getData('dataset');
if (dataset) {
    dataset = dataset.resurrect();
    url = url.concat(`?dataset=${dataset}`);
}

window.location = url;

