script:
const cdb = new CDB();

cdb.fetchList().then(async (list) => {
    let datasets = [];
    for (let i = 1; i < list.length; i++) {
        datasets.push({
            label: list[i].name.split('.')[0].split('/')[1],
            name: list[i].name
        })
    }
    API.createData('datasets', datasets);
})

